                <div className="flex flex-col">
                    <span className="text-xs font-bold text-gray-500 uppercase tracking-wide">{stat.label}</span>
                    {isActive && (
                        <motion.span 
                            initial={{ opacity: 0, height: 0 }} 
                            animate={{ opacity: 1, height: 'auto' }}
                            className="text-[10px] text-gray-400 font-medium"
                        >
                            {stat.sub}
                        </motion.span>
                    )}
                </div>
              </div>

              <div className="flex items-center gap-3">
                <span className={`text-xl font-black tracking-tighter ${stat.color}`}>{stat.value}</span>
                <ArrowUpRight size={14} className={isActive ? "text-[#D62828]" : "text-gray-300"} />
              </div>
            </motion.div>
          );
        })}
      </div>

      {/* --- FOOTER (Bottom 15%) --- */}
      <div className="h-[15%] shrink-0 flex items-center justify-between px-8 border-t border-gray-100 bg-gray-50/50 backdrop-blur-sm text-[10px] font-bold text-gray-400 uppercase tracking-wider relative">
        <div className="flex items-center gap-3">
          <div className="flex items-center gap-1.5">
             <Globe size={12} />
             <span>US-EAST-1</span>
          </div>
          <div className="w-px h-3 bg-gray-300"></div>
          <div className="flex items-center gap-1.5">
             <Server size={12} />
             <span>99.9% Uptime</span>
          </div>
        </div>

        <div className="flex items-center gap-2">
          <ShieldCheck size={12} className="text-emerald-500" />
          <span className="text-emerald-700">AES-256 Encrypted</span>
        </div>

        {/* Decorative bottom progress line */}
        <div className="absolute bottom-0 left-0 h-0.5 bg-gray-200 w-full">
            <motion.div 
                className="h-full bg-[#D62828]" 
                initial={{ width: "0%" }}
                animate={{ width: "100%" }}
                transition={{ duration: 10, repeat: Infinity, ease: "linear" }}
            />
        </div>
      </div>
    </div>
  );
}

